import React from 'react';
import './home.css';

import logoTranscender from '../../assets/LOGO_luz.png'

export default () => {
  return (
    <div className='box-home'>
      <h1>
        <img src={logoTranscender} title='Transcender' />
      </h1>
      <h4>Cerimonial de Despedida e Memorial On-line</h4>
      <p>uma plataforam gratuita para dar suporte à realização de cerimoniais de despedida a distância e para o registro de memoriais de entes queridos</p>
    </div>
    );
}
